. Thank you to the TGA family and The WeedNerds for all of your love and support.
Thank you to Sub for your contributions and for the good times.
Please let others see the true damage that drugs and alcohol can cause and did cause.
Sub passed of natural causes, however his battle with addiction caused a lot of pain for him and many others.
Sub I’m so sorry for your internal battles and I’m happy for you that you are now free.
Dioxide, Suny, Heroes of the Farm, Homegrown Natural Wonders, Geek Mike, Jinx, Miss Rose, Mendo Dope, Urbman, The Soil King, TC, Frenchie, everyone we every worked with or was touched by, thank you for the memories. 
We had a lot of amazing times that I will never forget. 
We all wrote a piece of cannabis history together, you are all very special in my heart.
May Sub and everyone involved find peace.
Remember the good times and let the bad times become growth.
Much love and respect!
Until the wheels fall off!
