JILLY BEAN
(Orange Velvet x Space Queen)

Tasting like an Orange Dreamsicle on a warm summer day.

She is known to provide relief from PTSD, anxiety and depression she is very uplifting and happy while also combating the pain & effects of pms & endometriosis.
She may even make you a little “Frisky” according to reports.

Jilly Bean is known &  loved world wide and winner of multi awards over the years in all of her forms.

This beautiful lady is being grown by @theclonedaddy .

The Jilly Bean lady pictured is from a traditional female-male pairing, however the feminized version is currently in testing and should be available Fall 2021.

